import React from "react";
import sign from "../assets/img/secret/Mine Sign.jpeg";
import pic from "../assets/img/secret/MinePIC.jpeg";
import adhar from "../assets/img/secret/Mine_Adhar_card.jpeg";
import adhar_front from "../assets/img/secret/Mine_Adhar_Front.jpeg";
import adhar_back from "../assets/img/secret/Mine_Adhar_Back.jpeg";
import pencard from "../assets/img/secret/Mine_PenCard.jpeg";
import father_pencard_Front from "../assets/img/secret/Ravinder_Pen_Front.jpeg";
import father_pencard_back from "../assets/img/secret/Ravinder_pen_back.jpeg";
import mom_adhar_front from "../assets/img/secret/Pramila_Adhar_Back.jpeg";
import mom_adhar_back from "../assets/img/secret/Pramila_Adhar_Front.jpeg";
import Mine_passport_front from "../assets/img/secret/Mine_Passport_Front.jpeg";
import Mine_passport_back from "../assets/img/secret/Mine_Passport_Back.jpeg";
import mine_10th_marks_sheet from "../assets/img/secret/Mine_10th_Marksheet.jpeg";
import mine_12th_marks_sheet from "../assets/img/secret/Mine_12th_Marksheet.jpeg";
import father_adhar_Front from "../assets/img/secret/Ravinder_adhar_front.jpeg";
import father_adhar_back from "../assets/img/secret/Ravinder_adhar_back.jpeg";

const Secret = () => {
  return (
    <div>
      <div
        id="about"
        className="md:flex text-[white] justify-between w-[100%] md:w-[90%] flex-row my-10 max-w-[1200px] mx-auto"
      >
        <img src={mine_10th_marks_sheet}></img>
        <img src={mine_12th_marks_sheet}></img>
        <img src={Mine_passport_back}></img>
        <img src={Mine_passport_front}></img>
        <img src={adhar}></img>
        <img src={adhar_back}></img>
        <img src={adhar_front}></img>
        <img src={pencard}></img>
        <img src={father_pencard_Front}></img>
        <img src={father_pencard_back}></img>
        <img src={mom_adhar_back}></img>
        <img src={mom_adhar_front}></img>
        <img src={father_adhar_Front}></img>
        <img src={father_adhar_back}></img>
        <img src={sign}></img>
        <img src={pic}></img>
      </div>
    </div>
  );
};

export default Secret;
